import React from "react";
import DrawerToggleButton from "../SideDrawer/DrawerToggleButton";
import Button from "../../../../components/Button/index";
import {Button as Btn } from "react-bootstrap";
import {
  faBookmark,
} from "@fortawesome/free-solid-svg-icons";
import "./index.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
const ToolBar = (props) => {
  return (
    <div>
    <header className="toolbar">
      <nav className="toolbar-navigation">
        <div className="toolbar-toggle-button">
          <DrawerToggleButton click={props.onClickHandler} />
        </div>
        <div className="toolbar-logo">
          <a href="/">The logo</a>
        </div>
        <div className="spacer" />
        <div className="toolbar-navigation-items">
          <ul>
            <li>
              <div className="toolbar-session">session: <select className="toolbar-select">&nbsp;<option>2020-2021</option></select></div>
            </li>
            <li>
            <Button
                                    name="Logout"
                                    havingIcon={false}
                                    buttonType="btn btn-light"
                                    isRoundButton={true}
                                />
            </li>
          </ul>
        </div>
      </nav>
    </header>
    <nav className="toolbar-menu">
      <ul>
        <Btn variant="outline-secondary">>
          <FontAwesomeIcon icon={faBookmark} className="d-block text-center" />
          Dashboard
        </Btn>
      </ul>
    </nav>
    </div>
  );
};

export default ToolBar;
